import React from "react";
import { Link } from "react-router-dom";
import { Affix } from "antd";
import "./nav.css";

const Nav = () => {
  return (
    <Affix>
      <div className="wrapper">
        <Link to="/" style={{ fontWeight: "bold", color: "black" }}>
          <h1>통과했수</h1>
        </Link>
        <nav style={{ borderBottom: "solid 1px", paddingBottom: "1rem" }}>

        </nav>
      </div>
    </Affix>
  );
};

export default Nav;
